import react from "react";

let Tame = new Date().toLocaleTimeString();

function App(){
    return (
    <>
    <div>
        <h1>{Tame}</h1>
        <button onClick = "updatedtime()"> Time update </button>
    </div>
    </>)
}

function updatedtime(){
    return tame = new Date().toLocaleTimeString();
}
export default App;
